import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
      <header className="App-header">
        <h1 id="main-heading">The <br></br>Ultimate <br></br>Moviegoers <br></br>Guide</h1>
      </header>
      </div>

    </div>
  );
}

export default App;
